import React from 'react';

function VideoOutput (props) {
  return (
    <div className="video">
      <div className="videoList">
        <div className="image">{props.videoTitle}</div>
        <div className="name">Название</div>
        <div className="chanel">Заголовок</div>
      </div>
    </div>
  )
}

export default VideoOutput
